import React from 'react';
import './App.css';
import Button from 'react-bootstrap/Button';
import ToggleButtonGroup from 'react-bootstrap/ToggleButtonGroup'
import 'bootstrap/dist/css/bootstrap.min.css';
// import {globe.png} from'./assets/images';

function App() {
  return (
    <div className='App'>
      <div className="first-upper">
        <div className="first-half">
          <div className="looking-for-a-lollip">Looking for a lollipop alternative?</div>
          <div className="body">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s.</div>
          <div style={{float:'left'}}>
            <button className="bg cta-text">Primary CTA</button>{' '}
            <button className="outline second-cta-text">Secondary CTA</button>{' '}
            {/* <Button variant="primary">Primary CTA</Button>{' '}
            <Button variant="outline-primary">Secondary CTA</Button>{' '} */}
          </div>
          <ToggleButtonGroup></ToggleButtonGroup>
        </div>
        <div className="second-half">
          <img src={require('./assets/images/globe.png')}></img>
        </div>      
      </div>
    </div>    
  );
}

export default App;
